/* Apagando tabelas para reestruturação */
drop table IF EXISTS ensaios_doencas;
drop table IF EXISTS genotipos_doencas;
drop table IF EXISTS ensaios;
drop table IF EXISTS genotipos;
drop table IF EXISTS locais;
drop table IF EXISTS cidades;
drop table IF EXISTS tipos_de_graos;
drop table IF EXISTS doencas;

/*------------------------------------
* Recriando cidades
*/------------------------------------

/* Tabela cidades */
CREATE TABLE public.cidades
(
    id bigserial NOT NULL,
    nome text NOT NULL,
    id_estado bigint NOT NULL,
    PRIMARY KEY (id),
    CONSTRAINT "FK_CIDADES_ESTADOS" FOREIGN KEY (id_estado)
        REFERENCES public.estados (id) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION
        NOT VALID
);

/* Tabela locais */
CREATE TABLE public.locais
(
    id bigserial NOT NULL,
    nome text NOT NULL,
    id_cidade bigint NOT NULL,
    PRIMARY KEY (id),
    CONSTRAINT "FK_LOCAIS_CIDADES" FOREIGN KEY (id_cidade)
        REFERENCES public.cidades (id) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION
        NOT VALID
);

/* Tabela tipo de grao */
CREATE TABLE public.tipos_de_graos
(
    id bigserial NOT NULL,
    sigla text NOT NULL,
    PRIMARY KEY (id)
);

/* Tabela genotipos */
CREATE TABLE public.genotipos
(
    id bigserial NOT NULL,
    nome text NOT NULL,
    id_tipo_grao bigserial NOT NULL,
    PRIMARY KEY (id),
    CONSTRAINT "FK_GENOTIPO_TIPO_GRAO" FOREIGN KEY (id_tipo_grao)
        REFERENCES public.tipos_de_graos (id) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION
        NOT VALID
);

/* Tabela ensaios */
CREATE TABLE public.ensaios(
   id                                                       bigserial NOT NULL,
   id_ensaio                                                TEXT NOT NULL,
   safra													TEXT NOT NULL,
   irrigacao                                                BOOLEAN NOT NULL,
   fungicida                                                BOOLEAN NOT NULL,
   repeticao                                                NUMERIC NOT NULL,
   produtividade                                            FLOAT NOT NULL,
   data_semeadura                                           DATE,
   data_emergencia                                          DATE,
   data_inicio_floracao                                     DATE,
   data_inicio_ponto_colheita                               DATE, 
   data_inicio_colheita                                     DATE,
   id_local                                                 BIGINT  NOT NULL,
   id_genotipo                                              BIGINT  NOT NULL,
   id_cultura                                               BIGINT  NOT NULL,
  CONSTRAINT "FK_ENSAIOS_LOCAL" FOREIGN KEY (id_local)
        REFERENCES public.locais (id) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION
        NOT VALID,
  CONSTRAINT "FK_ENSAIOS_GENOTIPO" FOREIGN KEY (id_genotipo)
        REFERENCES public.genotipos (id) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION
        NOT VALID,
  CONSTRAINT "FK_ENSAIOS_CULTURA" FOREIGN KEY (id_cultura)
        REFERENCES public.cultura (id) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION
        NOT VALID,
	
	primary key(id)
		
);

/* Tabela doencas */
CREATE TABLE public.ensaios_doencas(
	id  bigserial NOT NULL,
	FO  float,
	FS  float,
	id_ensaio bigint,
	primary key(id),
	FOREIGN KEY (id_ensaio) REFERENCES ensaios(id)
);

